contracts/voting.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract VotingSystem {
    // Structure to represent a single proposal
    struct Proposal {
        string name;
        uint256 voteCount;
    }

    // The address of the contract creator (admin)
    address public admin;

    // Array to store the list of proposals
    Proposal[] public proposals;

    // Mapping to keep track of whether an address has already voted
    mapping(address => bool) public hasVoted;

    // Modifier to restrict certain functions to the contract admin
    modifier onlyAdmin() {
        require(msg.sender == admin, "Only the admin can perform this action.");
        _;
    }

    // Event to be emitted when a vote is cast
    event VoteCasted(address indexed voter, uint256 indexed proposalIndex);

    // Constructor to initialize the contract with a list of proposal names
    constructor(string[] memory proposalNames) {
        admin = msg.sender;
        for (uint256 i = 0; i < proposalNames.length; i++) {
            proposals.push(Proposal({name: proposalNames[i], voteCount: 0}));
        }
    }

    // Function to cast a vote for a specific proposal
    function vote(uint256 proposalIndex) public {
        require(proposalIndex < proposals.length, "Invalid proposal index.");
        require(!hasVoted[msg.sender], "You have already voted.");

        proposals[proposalIndex].voteCount++;
        hasVoted[msg.sender] = true;

        emit VoteCasted(msg.sender, proposalIndex);
    }

    // Function to get the total number of proposals
    function getProposalCount() public view returns (uint256) {
        return proposals.length;
    }

    // Function to get the details of a specific proposal
    function getProposal(uint256 proposalIndex) public view returns (string memory, uint256) {
        require(proposalIndex < proposals.length, "Invalid proposal index.");
        return (proposals[proposalIndex].name, proposals[proposalIndex].voteCount);
    }

    // Function to add a new proposal (onlyAdmin)
    function addProposal(string memory proposalName) public onlyAdmin {
        proposals.push(Proposal({name: proposalName, voteCount: 0}));
    }

    // Function to remove a proposal (onlyAdmin)
    function removeProposal(uint256 proposalIndex) public onlyAdmin {
        require(proposalIndex < proposals.length, "Invalid proposal index.");
        delete proposals[proposalIndex];
    }

    // Function to change the admin address (onlyAdmin)
    function changeAdmin(address newAdmin) public onlyAdmin {
        require(newAdmin != address(0), "Invalid admin address.");
        admin = newAdmin;
    }
}

